export default function AboutMe({verticalMode}) {
    return (
        <section id="about-me">        
            <div className={verticalMode ? "center-wrapper" : "center-wrapper thin"}>
                <p>I am a software engineer. I use JavaScript (including React, which I used to make this page), Java, C, C#, HTML, CSS, and Lua.
                    If you are not me and you are seeing this text, it means that I forgot to update this before pushing the changes to the site. Oops.
                    It also probably means that I forgot to add something to make this text display wider on mobile. Unfortunate!
                </p>
            </div>
        </section>
    );
}
